import React, { useEffect, useState } from "react";
import Routes from "../../Routes/Routes";
import { NavLink, useHistory, useLocation } from "react-router-dom";
import Header from "../../components/header/header";
import PastCampaign from "../../components/influencer/past-campaign";
import CurrentCampaign from "../../components/influencer/current-campaign";
import { apiCall } from "../../utils/common";
import Loader from "../../utils/Loader";
import { displayLog } from "../../utils/functions";
import { Image } from "antd";

import "antd/dist/antd.css";
import { Tabs } from "antd";
const { TabPane } = Tabs;

function InfluencerView(props) {
  const history = useHistory();
  const {
    campaign_id,
    user_id,
    campaign_title,
    user_name,
    job_count,
    count,
    topRatedAmountWise,
    topRatedRatingWise,
  } = useLocation().state;
  const [loading, setLoading] = useState(true);
  const [influencerview, setInfluencerview] = useState([]);
  const [reviewRating, setReviewRating] = useState([]);
  const [viewCampList, setViewCampList] = useState([]);
  const [amount, setAmount] = useState({});
  const [imageurl, setImageurl] = useState();
  const [pageno, setPageno] = useState(1);
  const [limit, setLimit] = useState(10);
  // const [searchBySelect, setsearchBySelect] = useState("");

  useEffect(() => {
    getCampaigns();
    getratingandreview();
    viewCurrentCampaignList();
  }, []);

  //Get the View Applicant Details
  const getCampaigns = async () => {
    let req_data = {
      id: user_id,
      campaign_id: campaign_id,
      role: localStorage.getItem("role"),
    };

    let res = await apiCall("POST", "viewApplicantDetail", req_data);
    if (res.data.length > 0) {
      setLoading(false);
      // setImageurl(res.data.url);
      setInfluencerview(res.data[0]);
      setAmount(res.amount);
    } else {
      setLoading(false);
    }
  };
  //viewCurrentCampaignList
  const viewCurrentCampaignList = async () => {
    let req_data = {
      id: user_id,
      // campaign_id: campaign_id,
      role: +localStorage.getItem("role"),
    };

    let res = await apiCall("POST", "viewCurrentCampaignList", req_data);
    // console.log("RESSSS", res);
    if (res.data.length > 0) {
      setLoading(false);

      setViewCampList(res.data);
    } else {
      setLoading(false);
    }
  };
  //Get the rating and review status
  const getratingandreview = async () => {
    let req_data = {
      id: user_id,

      role: +localStorage.getItem("role"),
    };
    // console.log("BOdy----", req_data);
    let res = await apiCall("POST", "getratingandreview ", req_data);
    // console.log("RES----", res);
    if (res.data.length > 0) {
      setLoading(false);
      // setImageurl(res.data.url);
      setReviewRating(res.data);
    } else {
      setLoading(false);
    }
  };
  const handleSelect = async (userCampId) => {
    let req_data = {
      user_campaign_id: userCampId,
      participate_request: 2,
      role: localStorage.getItem("role"),
    };
    // console.log("BODY", req_data);
    let res = await apiCall("POST", "acceptParticipantRequest", req_data);
    if (res.code == 1) {
      setLoading(false);
      // history.push
      history.push({
        pathname: Routes.CAMPAIGN,
        state: {
          merchant_id: res.data.merchant_id,
          campaign_id: campaign_id,
          campaign_title: campaign_title,
        },
      });
    } else if (res.code == 0) {
      displayLog(res.code, res.message);
    }
    // console.log("helo", user_id);
  };
  return (
    <div>
      <Header />
      <section className="taskview influencer-view">
        <div className="container">
          <ul className="d-flex breadcrumbTop">
            <li>
              <NavLink to={Routes.MERCHANTSLIST}>
                {" "}
                {localStorage.getItem("merchant_name")}{" "}
              </NavLink>
            </li>
            <li>
              <NavLink to={Routes.MERCHANTSCAMPAIGNS}> Campaign List </NavLink>
            </li>

            <li>Influencer View</li>
          </ul>{" "}
          <br />
          {loading == true ? (
            <div>
              <Loader />
            </div>
          ) : (
            <>
              <div className="taskview-content mt-0">
                {topRatedRatingWise == true || topRatedAmountWise == true ? (
                  <div className="topRated-full">
                    <img src="images/award.png" alt="" />
                    TOP RATED
                  </div>
                ) : null}
                {/* <div className="topRated-full">
                  <img src="images/award.png" alt="" />
                  TOP RATED
                </div> */}
                <div className="rated-user-profile">
                  <div className="rated-userLeft">
                    <div className="rated-user">
                      <Image
                        // className="img-fluid w-100"
                        src={
                          influencerview?.profile_images
                            ? "https://fameonyou.s3.ap-southeast-1.amazonaws.com" +
                              influencerview.profile_images[0]
                            : "data:image/png;base64,"
                        }
                        fallback="data:image/png;base64,"
                      />
                      {/* <img
                        src={
                          influencerview?.profile_images
                            ? "https://fameonyou.s3.ap-southeast-1.amazonaws.com" +
                              influencerview.profile_images[0]
                            : "images/Defaultimage.jpeg"
                        }
                        alt=""
                      /> */}
                    </div>
                    <div className="rated-user-detail">
                      <h3>
                        {" "}
                        {influencerview?.user_name
                          ? influencerview?.user_name
                          : "N/A"}
                      </h3>
                      <p>
                        <i class="fas fa-map-marker-alt"></i>{" "}
                        {influencerview?.state} , {influencerview?.country}
                      </p>
                    </div>
                  </div>
                  <div className="influencerBtn">
                    {/* {item.participate_request == 1 ? (
                          <button
                            className="btn btn-default-blue"
                            title="View"
                            onClick={() => {
                              goInfluencerView(item.campaign_id, item.user_id);
                            }}
                          >
                            View
                          </button>
                        ) : (
                          ""
                        )} */}
                    {influencerview?.participate_request != 2 ? (
                      <button
                        // to={Routes.HOME}
                        className="btn btn-default-blue"
                        title="Select"
                        onClick={() =>
                          handleSelect(influencerview.user_campaign_id)
                        }
                      >
                        Select
                      </button>
                    ) : influencerview?.participate_request == 2 ? (
                      <button
                        // to={Routes.HOME}
                        className="btn btn-default-blue"
                        title="Select"
                        // onClick={() =>
                        //   handleSelect(influencerview.user_campaign_id)
                        // }
                      >
                        Hired
                      </button>
                    ) : null}
                  </div>
                </div>
                <div className="rate-followers-detail">
                  <ul className="rate-followers">
                    <li>
                      <span>{count ? count : "0"}</span>
                      <label>Followers</label>
                    </li>
                    <li>
                      <span>${amount.amount / 1000}k</span>
                      <label>Total Earned</label>
                    </li>
                    <li>
                      <span>{job_count ? job_count : "0"}</span>
                      <label>Total Jobs</label>
                    </li>
                  </ul>
                  <div className="commonSocial">
                    <ul className="mt-0">
                      {influencerview.facebook_profile_url != "null" || null ? (
                        <li>
                          <a
                            href={
                              "https://" + influencerview.facebook_profile_url
                            }
                            target="_blank"
                          >
                            {" "}
                            <img
                              src="images/icon-facebook.png"
                              alt=""
                              target="_blank"
                            />
                          </a>
                        </li>
                      ) : null}
                      {influencerview.instagram_profile_url != "null" ||
                      null ? (
                        <li>
                          <a
                            href={
                              "https://" + influencerview.instagram_profile_url
                            }
                            target="_blank"
                          >
                            <img src="images/icon-instagram.png" alt="" />
                          </a>
                        </li>
                      ) : null}
                      {influencerview.twitter_profile_url != "null" || null ? (
                        <li>
                          <a
                            href={
                              "https://" + influencerview.twitter_profile_url
                            }
                            target="_blank"
                          >
                            <img
                              src="images/icon-twitter.png"
                              alt=""
                              target="_blank"
                            />
                          </a>
                        </li>
                      ) : null}
                      {influencerview.tiktok_profile_url != "null" || null ? (
                        <li>
                          <a
                            href={
                              "https://" + influencerview.tiktok_profile_url
                            }
                            target="_blank"
                          >
                            {" "}
                            <img
                              src="images/icon-tiktok.png"
                              alt=""
                              target="_blank"
                            />
                          </a>
                        </li>
                      ) : null}
                    </ul>
                  </div>
                </div>
                <div className="influencerContent">
                  <div className="influencerHead">
                    <h3>Youtube influencer, Traveler</h3>
                    <p>{influencerview?.bio ? influencerview?.bio : "N/A"}</p>
                  </div>
                  <div className="influencerPicture">
                    <div className="row row-2">
                      {influencerview?.display_picture?.length > 0
                        ? influencerview?.display_picture?.map(
                            (item, index) => (
                              <div
                                className="col-6 col-sm-4 col-lg-2 col-div-2"
                                key={index}
                              >
                                <div className="infImgBox">
                                  <Image
                                    className="img-fluid"
                                    src={
                                      item
                                        ? "https://fameonyou.s3.ap-southeast-1.amazonaws.com" +
                                          item
                                        : "data:image/png;base64,"
                                    }
                                    fallback="data:image/png;base64,"
                                  />
                                </div>
                              </div>
                            )
                          )
                        : null}
                    </div>
                  </div>
                  {console.log("reviewRating", reviewRating.length)}
                  <div className="influencerHistory">
                    <h3>Work History</h3>
                    <Tabs defaultActiveKey="1" className="custom-tabs">
                      <TabPane
                        tab={`Past Campaign (${reviewRating?.length})`}
                        key="1"
                      >
                        <PastCampaign reviewRating={reviewRating} />
                      </TabPane>
                      <TabPane
                        tab={`Current Campaign (${viewCampList?.length})`}
                        key="2"
                      >
                        <CurrentCampaign viewCampList={viewCampList} />
                      </TabPane>
                    </Tabs>
                  </div>
                  {/* <div className="taskPostBtn d-flex justify-content-between">
                    <NavLink to={Routes.HOME} className="btn btn-default-blue">
                      Back
                    </NavLink>
                  </div> */}
                </div>
              </div>
            </>
          )}
        </div>
      </section>
    </div>
  );
}

export default InfluencerView;
